import React from "react";
import styled from "styled-components";

const StyleCulcolator = styled.div`
    background-color: #718792;
    width: 350px;
    height: 550px;
    margin: auto;
    display: flex;
    flex-direction: column;
    margin-top: 150px;
    border-radius: 10px;
`;

// const AllCul = styled.div`
//     margin: auto;
// `;

const Display = styled.div`
    width: 310px;
    height: 50px;
    background-color: #eceff1;
    border-radius: 10px;
    margin: auto;
`;

const Keyboard = styled.div`
    width: 330px;
    height: 470px;
    background-color: #90a4ae;
    margin: auto;
`;
const Culcolator = () => {
    return (
        <StyleCulcolator>
            <Display></Display>
            <Keyboard></Keyboard>
        </StyleCulcolator>
    );
};

export default Culcolator;
